import React from "react";
import { Section, Container, Row, Column, TextWrapper, TopLine, Heading, Subtitle, ImgWrapper, Img, Button } from "../../styles";

function Feedback() {
    return (
        <Section lightBg={true}>
            <Container>
                <Row imgStart={true}>
                    <Column>
                        <TextWrapper>
                            <TopLine lightTopLine={true}>The feed back from real users</TopLine>
                            <Heading lightText={true}>What companies they got into</Heading>
                            <Subtitle lightTextDesc={true}>Reviews</Subtitle>
                        </TextWrapper>
                    </Column>

                    <Column>
                        <ImgWrapper start={true}>
                            <Img src={require("../../images/profile.jpg")} alt={""} />
                        </ImgWrapper>
                    </Column>
                </Row>
            </Container>
        </Section>
    );
}

export default Feedback;
